package sgs.env.ecabsdriver.model;

public class SearchConfig {
	private String searchRadius,searchFrequency,seacrhMinDistance,minSoc;
	
	public String getMinSoc() {
		return minSoc;
	}
	
	public void setMinSoc(String minSoc) {
		this.minSoc = minSoc;
	}
	
	public String getSearchRadius() {
		return searchRadius;
	}
	
	public void setSearchRadius(String searchRadius) {
		this.searchRadius = searchRadius;
	}
	
	public String getSearchFrequency() {
		return searchFrequency;
	}
	
	public void setSearchFrequency(String searchFrequency) {
		this.searchFrequency = searchFrequency;
	}
	
	public String getSeacrhMinDistance() {
		return seacrhMinDistance;
	}
	
	public void setSeacrhMinDistance(String seacrhMinDistance) {
		this.seacrhMinDistance = seacrhMinDistance;
	}
	
	
}
